import React from "react";
import "./NavBar.css";
import { NavLink } from "react-router-dom";
import { useIsAuthenticated, useAuthUser } from "react-auth-kit";

const NavigationBar = () => {
  const authUser = useAuthUser();
  const isAuthenticated = useIsAuthenticated();
  return (
    <nav>
      <ul className="side left-side">
        <a
          id="news"
          href="/"
          className={({ isActive }) => (isActive ? "active" : undefined)}
          end
        >
          Home
        </a>
        <a
          href="/login"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          Login
        </a>

        <a
          href="register"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          Register
        </a>

        <a
          href="contact"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          Home
        </a>

        <a
          href="about"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          Study
        </a>

        <a
          href="presentation"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          Academy
        </a>

        <a
          href="activePresentations"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          MarketPlace
        </a>
      </ul>

      <ul className="side right-side">
        <a
          id="contact-sales"
          href="joinALecture"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          Contact Sales
        </a>

        <a
          href="signOut"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          Explore Content
        </a>

        <a
          href="signOut"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          Play
        </a>

        <a
          id="sign-up"
          href="signOut"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          Sign Up
        </a>

        <a
          href="signOut"
          className={({ isActive }) => (isActive ? "active" : undefined)}
        >
          Log in
        </a>
      </ul>
    </nav>
    // {isAuthenticated() && (
    //   <div className="user-greeting">Hello {authUser().firstName}</div>
    // )}
  );
};

export default NavigationBar;
